<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientAllowedRedirectsListRef;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientCodeVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientPublicAllowVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientSecretOauthVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientEnabledVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientAllowedRedirectsVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientAllowedRedirectsUidVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientAllowedRedirectsUrlVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientAllowedRedirectsVersionVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientAllowedRedirectsItem;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Domain\ValueObject\TrustedClientVersionVO;
use Civi\Lughauth\Features\Access\Master\TrustedClient\Application\Usecase\Enable\TrustedClientEnableResult;
use PHPUnit\Framework\TestCase;

final class TrustedClientEnableResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new TrustedClientEnableResult();
        $codeOneValue = 'one';
        $codeOtherValue = 'other';
        $copy = $value->code($codeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getCode());
        $this->assertNotEquals('other', $value->getCode());
        $this->assertEquals('one', $value->getCodeOrDefault(TrustedClientCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('other', $value->getCodeOrDefault(TrustedClientCodeVO::from($codeOtherValue))->value());
        $value->unsetCode();
        $this->assertEquals('other', $value->getCodeOrDefault(TrustedClientCodeVO::from($codeOtherValue))->value());
        $this->assertNotEquals('one', $value->getCodeOrDefault(TrustedClientCodeVO::from($codeOtherValue))->value());
        $publicAllowOneValue = true;
        $publicAllowOtherValue = false;
        $copy = $value->publicAllow($publicAllowOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isPublicAllow());
        $this->assertNotEquals(false, $value->isPublicAllow());
        $this->assertEquals(true, $value->getPublicAllowOrDefault(TrustedClientPublicAllowVO::from($publicAllowOtherValue))->value());
        $this->assertNotEquals(false, $value->getPublicAllowOrDefault(TrustedClientPublicAllowVO::from($publicAllowOtherValue))->value());
        $value->unsetPublicAllow();
        $this->assertEquals(false, $value->getPublicAllowOrDefault(TrustedClientPublicAllowVO::from($publicAllowOtherValue))->value());
        $this->assertNotEquals(true, $value->getPublicAllowOrDefault(TrustedClientPublicAllowVO::from($publicAllowOtherValue))->value());
        $secretOauthOneValue = 'cyphered://cypher';
        $secretOauthOtherValue = 'cyphered://ocyphered';
        $copy = $value->secretOauth($secretOauthOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('cyphered://cypher', $value->getSecretOauth());
        $this->assertNotEquals('cyphered://ocyphered', $value->getSecretOauth());
        $this->assertEquals('****er', $value->getSecretOauthOrDefault(TrustedClientSecretOauthVO::from($secretOauthOtherValue))->value());
        $this->assertNotEquals('****ed', $value->getSecretOauthOrDefault(TrustedClientSecretOauthVO::from($secretOauthOtherValue))->value());
        $value->unsetSecretOauth();
        $this->assertEquals('****ed', $value->getSecretOauthOrDefault(TrustedClientSecretOauthVO::from($secretOauthOtherValue))->value());
        $this->assertNotEquals('****er', $value->getSecretOauthOrDefault(TrustedClientSecretOauthVO::from($secretOauthOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isEnabled());
        $this->assertNotEquals(false, $value->isEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(TrustedClientEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(TrustedClientEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(TrustedClientEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(TrustedClientEnabledVO::from($enabledOtherValue))->value());
        $allowedRedirectsOneValue = new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('one'),
            TrustedClientAllowedRedirectsUrlVO::from('one'),
            TrustedClientAllowedRedirectsVersionVO::from(1)
        ));
        $allowedRedirectsOtherValue = new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('other'),
            TrustedClientAllowedRedirectsUrlVO::from('other'),
            TrustedClientAllowedRedirectsVersionVO::from(2)
        ));
        $copy = $value->allowedRedirects($allowedRedirectsOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('one'),
            TrustedClientAllowedRedirectsUrlVO::from('one'),
            TrustedClientAllowedRedirectsVersionVO::from(1)
        )), $value->getAllowedRedirects());
        $this->assertNotEquals(new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('other'),
            TrustedClientAllowedRedirectsUrlVO::from('other'),
            TrustedClientAllowedRedirectsVersionVO::from(2)
        )), $value->getAllowedRedirects());
        $this->assertEquals(new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('one'),
            TrustedClientAllowedRedirectsUrlVO::from('one'),
            TrustedClientAllowedRedirectsVersionVO::from(1)
        )), $value->getAllowedRedirectsOrDefault(TrustedClientAllowedRedirectsVO::from($allowedRedirectsOtherValue))->value());
        $this->assertNotEquals(new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('other'),
            TrustedClientAllowedRedirectsUrlVO::from('other'),
            TrustedClientAllowedRedirectsVersionVO::from(2)
        )), $value->getAllowedRedirectsOrDefault(TrustedClientAllowedRedirectsVO::from($allowedRedirectsOtherValue))->value());
        $value->unsetAllowedRedirects();
        $this->assertEquals(new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('other'),
            TrustedClientAllowedRedirectsUrlVO::from('other'),
            TrustedClientAllowedRedirectsVersionVO::from(2)
        )), $value->getAllowedRedirectsOrDefault(TrustedClientAllowedRedirectsVO::from($allowedRedirectsOtherValue))->value());
        $this->assertNotEquals(new TrustedClientAllowedRedirectsListRef(new TrustedClientAllowedRedirectsItem(
            TrustedClientAllowedRedirectsUidVO::from('one'),
            TrustedClientAllowedRedirectsUrlVO::from('one'),
            TrustedClientAllowedRedirectsVersionVO::from(1)
        )), $value->getAllowedRedirectsOrDefault(TrustedClientAllowedRedirectsVO::from($allowedRedirectsOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(TrustedClientVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(TrustedClientVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(TrustedClientVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(TrustedClientVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
